import React from "react";

import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';
import Checkbox from '@material-ui/core/Checkbox';
import SearchAppBar from "components/Navbars/SearchBar";

const StyledTableCell = withStyles(() => ({
    head: {
        backgroundColor: '#3f51b5',
        color: 'white',
    },
    body: {
        fontSize: 14,
    },
}))(TableCell);

// 

const StyledTableRow = withStyles((theme) => ({
    root: {
        '&:nth-of-type(odd)': {
            backgroundColor: theme.palette.action.hover,
        },
    },
}))(TableRow);

// 

const useStyles = makeStyles({
    table: {
        minWidth: 350,
    },
});

export default function Kpi3(props) {
    const classes = useStyles();
    return (
        <div>
            <SearchAppBar />
            <TableContainer component={Paper}>
                <Table className={classes.table} aria-label="customized table">
                    <TableHead>
                        <TableRow>
                            <StyledTableCell>SiteOrderID</StyledTableCell>
                            <StyledTableCell align="right">Site</StyledTableCell>
                            <StyledTableCell align="right">DateOrdered</StyledTableCell>
                            <StyledTableCell align="center">Status</StyledTableCell>
                            <StyledTableCell ></StyledTableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {props.data.map((row, index) => {
                            return (
                                <StyledTableRow key={index}>
                                    <StyledTableCell component="th" scope="row">{row.siteOrderID}</StyledTableCell>
                                    <StyledTableCell align="right">{row.siteOrderID}</StyledTableCell>
                                    <StyledTableCell align="right"></StyledTableCell>
                                    <StyledTableCell align="right"></StyledTableCell>
                                    <StyledTableCell><Checkbox /></StyledTableCell>
                                </StyledTableRow>
                            )
                        })}
                        <StyledTableRow >
                            <StyledTableCell component="th" scope="row"></StyledTableCell>
                            <StyledTableCell align="right"></StyledTableCell>
                            <StyledTableCell align="right"></StyledTableCell>
                            <StyledTableCell align="right"></StyledTableCell>
                            <StyledTableCell><Checkbox /></StyledTableCell>
                        </StyledTableRow>
                    </TableBody>
                </Table>
            </TableContainer>

        </div>
    );
}
